INSERT INTO `pages` (`id`, `page_name`, `heading`, `page_slug`, `banner`, `content`, `status`, `service_id`, `meta_title`, `meta_desc`, `meta_keys`) VALUES
(37, 'Container Specifications', 'Container Specifications', 'container-specifications', '1532333264.png', '<p>With the barges for inland navigation to mine-heads, plant jetties as well as for outer anchorage Lighterage, we provide complete logistics support for bulk cargo from storage to loading as well cargo handling from Mother Vessel to Shore.<br />\r\n<br />\r\nWe provide the traditional services of a stevedore, loading and unloading ship cargo and provide a cargo-handling service, transferring vessel-borne cargo to railroads and trucks, domestically and abroad.<br />\r\n<br />\r\nWith decades of experience and expertise in handling various types of cargo such as dry, bulk, container, heavy lifts etc., the company provides excellent stevedoring facilities at all major and minor ports in India and provide high productivity at very competitive rates.<br />\r\n&nbsp;</p>\r\n', 0, 17, '', '', ''),
(38, 'Ship Agency', 'Ship Agency', 'ship-agency', '1532337601.png', '<p>We handle over vessels at various Indian ports. These include: Bulk Carriers, Container Carriers, and Liner vessels, Car Carriers, Heavy Lifts, Other Supply Vessels, Product Tankers, LPG, LNG &amp; Ammonia carriers and Naval Vessels.<br />\r\n<br />\r\nArmed with years of experience and expertise, we are fully geared to handle all types of vessels at any port in India. Special arrangements include supply of shore crane, forklifts, private labours, tugs, barges, launches, embarking and disembarking operations. We maintain close liaison with port authorities, related government agencies, tourist bureaus, passenger handling companies, as well as, the Indian Navy.<br />\r\n<br />\r\nThe handling of project consignments including large over-dimensional cargoes on a door-to-door basis and from ports to inland locations. We are geared to handle a wide range of varied cargoes for transportation with equipment that includes Prime Movers, Hydraulic Axles, Heavy Lift, Mobile Cranes, Jacking &amp; Lifting systems, Tippers, Pay Loaders, and Trailers.<br />\r\n<br />\r\nThe scope of our services comprehensively covers all requirements of the vessel. We offer services to vessels at all major and minor ports on the coasts of India.<br />\r\n&nbsp;</p>\r\n', 1, 17, '', '', ''),
(39, 'Stevedoring & Lighterage ', 'Stevedoring & Lighterage ', 'stevedoring-lighterage', '1532512027.png', '<p>\r\n              With the barges for inland navigation to mine-heads, plant jetties as well as for outer anchorage Lighterage, we provide complete logistics support for bulk cargo from storage to loading as well cargo handling from Mother Vessel to Shore.<br><br>\r\n             We provide the traditional services of a stevedore, loading and unloading ship cargo and provide a cargo-handling service, transferring vessel-borne cargo to railroads and trucks, domestically and abroad.<br><br>\r\n             With decades of experience and expertise in handling various types of cargo such as dry, bulk, container, heavy lifts etc., the company provides excellent stevedoring facilities at all major and minor ports in India and provide high productivity at very competitive rates.<br><br>\r\n\r\n            </p>', 1, 17, '', '', ''),
(40, 'Rajni', 'Rajeev', 'rajni', '1568534594.jpg', '<p>Rajni Rajeev NairRRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev Nair</p>\r\n\r\n<p>[[accordion_mumbai-port-anchorage-discharge]]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev Nair</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev NairRajni Rajeev Nair</p>\r\n', 1, 19, 'Rajni Rajeev Nair', 'Rajni Rajeev Nair', 'Rajni Rajeev NairRajni Rajeev NairRajni Rajeev Nair'),
(41, 'MUMBAI PORT', 'MUMBAI PORT', 'mumbai-port', '1568535561.png', '<p>The port is administered by the Mumbai Port Trust (MbPT), an autonomous corporation wholly owned by the Government of India.</p>\r\n\r\n<p>[[accordion_mumbai-port-anchorage-discharge]]</p>\r\n\r\n<p>[[accordion_facilities-at-mumbai-port-both-anchorage-berth]]</p>\r\n<p>[[accordion_mumbai-port-berths-discharge-information]]</p>\r\n<p>[[accordion_drafts-declared-during-daily-berthing-meeting-on-05-aug-016-berth-drafts-sbt-to-favorable-tide]]</p>\r\n', 1, 18, 'Mumbai POrt', NULL, NULL);

